import { createIcon } from "../icon/createIcon";

export const TriangleLeftIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="TriangleLeftIcon">
    <path d="m8.5 11-5-5 5-5z" />
  </svg>,
  "TriangleLeft",
  "triangle left"
);
